import React from 'react'
import {Link} from 'react-router-dom'
export const Navigation = ()=>{
    return(
            <div className="navbar">
                <ul>
            <li><Link to="Events">Events</Link></li>
            <li></li>
            <li><Link to="Subscription">Subscription</Link></li>
            </ul>
            </div>
            
    )
}
